import React from 'react';
import Header from './components/Header';
import Balance from './components/Balance';
import IncomExpenses from './components/IncomeExpenses';
import './App.css';

function App() {
  return (
    <div>
      <Header />
      <div className='container'>
        <Balance />
        <IncomExpenses />
      </div>
    </div>
  );
}

export default App;
